import React from 'react';
import closeBtn from '../../icons/close.png'

export default function InfoBar({ room }) {
  return (
    <div className="InfoBar">
      <h1>{room}</h1>
      <button className="close-chat-btn" ><img src={closeBtn} alt="close"/></button>
    </div>
  )
}
